window.bookSummaryJSON = "<p>Fate is cruel and she will always force your hand.</p> <p>Solidifying my mate bond with Aiden was supposed to be a happy occasion. Instead, our union unleashed a curse, and now our survival hangs in the balance.</p> <p>As I try to right the wrongs of the past, the Hallowed Guild is determined to get in the way. My next steps are clear, but every move I make puts those around me in danger.</p> <p>Too much has happened for my destiny to be changed. I must embrace my role to untie the great divide between wolf shifter and witch. My mate and my people need me, and I can't let them down. My life isn't the one forfeit if I fail.</p>"; 
